DROP TABLE IF EXISTS Places;
DROP TABLE IF EXISTS Tags;

CREATE TABLE Tags(
	id_tag INT NOT NULL AUTO_INCREMENT,
	label_tag VARCHAR(30),
	PRIMARY KEY (id_tag)
) ENGINE = InnoDB;

CREATE TABLE Places(
	id_place INT NOT NULL AUTO_INCREMENT,
	nom_place VARCHAR(40),
	parent_tag_place INT,
	address_place VARCHAR(60),
	gpsx_place FLOAT,
	gpsy_place FLOAT,
	desc_place TEXT,
	url_place VARCHAR(30),
	openings_place TEXT,
	PRIMARY KEY (id_place),
	FOREIGN KEY (parent_tag_place) REFERENCES Tags(id_tag)
);












